INSERT INTO `comment` VALUES (32778,9,'No quiero esperar mas a subir el pronostico porque ya estan bajando las cuotas. Partido correspondiente a la 25ª jornada de la Primera Division espanola entre Real Madrid y Alaves que se disputara el sabado a las 16:15 horas en el Santiago Bernabeu (Madrid). Subo este pick por la la racha goleadora que atraviesan ambos equipos. Real Madrid ocupa la cuarta posicion (con un partido menos que se jugara manana) con 45 puntos (13V-6E-4D), con 55 goles a favor y 26 en contra. Parece que el Madrid ha resucitado, por lo menos en cuanto a resultados. Cristiano Ronaldo parece que recupera sensaciones, Bale esta enchufado, la pena es la lesion de Marcelo que volvia a ser el que era, aunque todavia quedan muchos jugadores que deben aumentar el nivel. De los 37 partidos oficiales disputados por el Madrid, en 22 han marcado los 2 equipos. Todos sabemos que el Madrid es un equipo goleador (segundo en este registro), pero la parcela defensiva se ha descuidado. Los maximos goleadores del equipo son Ronaldo con 12 goles (3 de penalti) y Bale y Asensio con 6 goles (ninguno de penalti). Alaves ocupa la decimocuarta posicion con 28 puntos (9V-1E-14D) 22 goles a favor y 33 en contra. La llegada del “Pitu” Abelardo ha sido como agua bendita, obteniendo 22 puntos de los 33 posibles, marcando 15 goles y recibiendo 11. Desde su llegada, de los 15 partidos disputados en 8 se cumpliria el pronostico y de los 5 no cumplidos fue el Alaves quien dejo la porteria a 0 (cosa que dudo mucho que ocurra en el Santiago Bernabeu). Este equipo ha mejorado mucho desde su llegada sobre todo en organizacion defensiva y tener claro a que juegan. Sus maximos goleadores son Munir con 6 goles (ninguno de penalti) y Ibai Gomez con 5 (1 de penalti). Ganaremos la apuesta si la marcan ambos equipos. Lo mas normal es que gane el Real Madrid, pero sube la cuota tan poco que viendo las dificultades en que pusieron al Barcelona en el Camp Nou, no le veo valor @2.2. Animo y a por el verde!',557084,32777),(32780,9,'LIGA BBVA Real Madrid vs Alaves = +3 goles vamos al partido del madrid para jugar esta apuesta ya que poco mas se puede jugar en este partido cuotas ridiculas pero si algo veo en este partido es a un madrid abusando de un rival mas devil que el madrid ya que el madrid parece que a vuelto con seriedad a sumar victorias y sus delanteros estan de vuelta con el gol por eso mismo creo que el madrid ira a bapulear y a continuar con sus buenas sensaciones a costa de un alaves que tiene una ligera mejoria con pitu abelardo ganando a rivales directos , pero todo el mundo sabemos que no es la liga de alaves entonces con estos argumentos veo al madrid goleando y metiendo sus tipicas goleadas en el bernabeu asi que buscaremos una apuesta ganadora !',557085,32779),(32782,9,'Gustazo el que da poder subir de nuevo cosas de Bet365. Para empezar con buen pie, me voy al partido del fin de semana en el Bernabeu entre el Real Madrid y el Alaves. Para acertarla, necesitaremos que el Madrid vaya al descanso con una diferencia de 2 goles, si gana de uno nula. Mucho valor esta cuota, que en otras casas la tenemos a 1,82. Es cierto que el Madrid juega hoy en Butarque, campo complicado, pero no tienen que desplazarse, otro punto a favor. Parece que quiere empezar a carburar el equipo de Zidane. Goleada a la Real Sociedad en el Bernabeu, remontada con el Psg y gran victoria, y otra buena remontada contra el Betis, metiendo 5 goles. Buen sintoma para los blancos, que venian con grandes dudas, y parece que estan recuperando esa chispa que le hacia falta, y eso se traduce en goles, 19 en los ultimos 5 partidos disputados, promediando casi 4 a favor. Para este partido no sabemos a quien sacara, pero seguro que un 11 de garantias que saldra a comerse el campo en los primeros 45 minutos. No hay mejor forma de subir la moral para el duelo trascendental en Paris que seguir goleando y haciendo disfrutar a la aficion. El rival es idoneo para ello, un rival que en Vitoria da bastante guerra pero fuera de suestadio bajan mucho el nivel y la intensidad. Ahora mismo son 15° en liga con 28 puntos. Llega despues de una racha de 3 victorias seguidas, una de ellas en un campo dificil como el Madrigal. Creo que aqui se acaba su racha, y posiblemente se vaya goleado de la capital. En los ultimos 3 enfrentamientos directos, en los 3 se fue ganando el Madrid al descanso, aun que solo por un gol, que nos anularia la apuesta. Es un pronostico que este ano en liga, y en el Bernabeu, habriamos acertado tan solo 3 veces. Precisamente dos de ellas fueron contra equipos vascos, la Real Sociedad y el Eibar. Habriamos fallado en 4 ocasiones, dos de ellas en aquellas noches raras donde el balon no queria entrar, frente a Valencia y Levante. Sin embargo, para mi lo importante es la actualidad, y en los ultimos 5 partidos en el Bernabeu en liga tenemos 3 victorias y 2 derrotas, frente a Barcelona y Villareal. Las victorias aplastantes : 5-0 al Sevilla, 7-1 al Depor y 5-2 a la Real Sociedad. Esperemos ver un Madrid con pegada que se vaya al descanso 2-0, o por lo menos ganando para que nos devuelvan. Suerte a quien la siga.',557086,32781),(32784,9,'La necesidad de ganar de ambos equipos es tan grande, que los dos saldran a ganar desde el minuto 1 del partido. El Athletic en sus ultimos 5 partidos en casa ha ganado 1 y empatado 4. Estos resultados no son habituales en San Mames, por lo que la aficion exigira una victoria, para alejarse del descenso y volver a sonar con jugar la Europa League. La sequia goleadora de sus dos delanteros Williams y Aduriz debe cambiar y ambos lucharan para conseguir de nuevo la senda del gol. El Malaga es colista, no juega bien y encima tiene mala suerte. La derrota de la semana pasada ante el Valencia, donde ganaba por 1-0 hasta el minuto 80 les servira para no conformarse con ganar con la minima. Saben que deben sumar de tres en tres para lograr la permanencia, asique saldran a por la victoria e intentaran meter goles sin mirar atras. El Athletic juega contra el colista en su casa y no puede defraudar a una grada que espera impaciente la victoria de su equipo. El Malaga tiene que ganar y para eso hay que marcar gol.',557087,32783),(32786,9,'Partido de liga de primera division espanola entre Valencia y Real sociedad. Mi pronostico es que ganan los locales. Veo muy dificil que la Real Sociedad saque algo de Valencia. El Valencia, fuerte en casa, solo ha dejado escapar los 3 puntos contra Barca, Real Madrid, Villarreal y Valencia, equipos potentes de la liga.Los demas los ha ganado, 8 de 12 partidos. Es uno de los equipos mas goleadores. La Real tiene un buen equipo, no es facil golear a Deportivo y Levante como lo ha hecho en casa,estando en la posicion que esta. En mi opinion deberia estar mas arriba,pero teniendo los problemas defensivos que tiene es imposible. Encaja goles de la nada, partidos dominados y a nada que le llegan y los delanteros rivales tienen calidad encajan gol. Rulli tampoco esta teniendo su ano, errores infantiles partido tras partido.Fueron a campos dificiles como Madrigal y Santiago Bernabeu y se acabo el partido en media hora. Eusebio no da con la tecla en ese aspecto.Ademas, cuenta con la baja de William Jose, jugador muy importante y veremos si Xabi Prieto tambien. La Real jugara un importante partido europeo el jueves y el Valencia llegara mas fresco. Suerte.',557088,32785),(32788,9,'Partido de liga de primera division espanola entre Valencia y Real sociedad. Mi pronostico es que el Valencia marca antes 2 goles. Repito los datos de mi pick anterior. El Valencia, fuerte en casa, solo ha dejado escapar los 3 puntos contra Barca, Real Madrid, Villarreal y Valencia, equipos potentes de la liga.Los demas los ha ganado, 8 de 12 partidos. Es uno de los equipos mas goleadores. La Real tiene un buen equipo, no es facil golear a Deportivo y Levante como lo ha hecho en casa,estando en la posicion que esta. En mi opinion deberia estar mas arriba,pero teniendo los problemas defensivos que tiene es imposible. Encaja goles de la nada, partidos dominados y a nada que le llegan y los delanteros rivales tienen calidad encajan gol. Rulli tampoco esta teniendo su ano, errores infantiles partido tras partido.Fueron a campos dificiles como Madrigal y Santiago Bernabeu y se acabo el partido en media hora. Eusebio no da con la tecla en ese aspecto.Ademas, cuenta con la baja de William Jose, jugador muy importante y veremos si Xabi Prieto tambien. La Real jugara un importante partido europeo el jueves y el Valencia llegara mas fresco. Pienso que el Valencia hara 2 goles minimo y a la Real le costara mas hacerlos. Suerte.',557089,32787),(32790,9,'Entiendo que la Real tiene muchas bajas arriba etc...aunque tambien veo jugadores en buena forma y ademas del juego que desarrollan por ahi tambien pueden venir los tiros de que el equipo se parta tanto fuera de casa en las transiciones, voy con los datos. Al Valencia le han marcado gol en sus ultimos 6 partidos como local y como todos sabemos lleva 12 partidos seguidos encajando; esta por encima del 65% de over en sus partidos. La Real anota en 3 de cada 4 partidos y ha marcado dos goles minimo en sus ultimos 4 partidos, 75% de over lleva en esta liga el mas alto de todos los equipos, el Valencia es el 4º. A 1.55 en verde.',557090,32789),(32792,9,'Gran partido el que veremos en Mestalla en esta jornada 25 de la Liga Santander y que enfrentara a Valencia y Real Sociedad. Voy a probar que el Valencia no pierde el partido y que se dan 3 o mas goles en el partido. Tambien tenia dudas de subir el ambos marcan y +2,5 goles pero finalmente me decanto por esta debido a su mayor cuota y la regularidad del Valencia en casa. Valencia se encuentra en la 3ª posicion (a la espera del Leganes vs Real Madrid del miercoles) con 46 puntos en una zona comoda para jugar la temporada que viene en Champions League ya que tiene 7 puntos mas que el 5º clasificado. Sin embargo, el conjunto txuri-urdin con 29 puntos se encuentra en la posicion 12 en una temporada muy irregular. Como local, un Valencia que se coloca como el 3º mejor local con 26 puntos en 12 partidos: 8 victorias, 2 empates y 2 derrotas; 25 goles a favor y 11 goles en contra. En cuanto a los resultados, las 8 victorias y los 2 empates nos valdrian para cumplir esta parte de la apuesta. En 7 de esos 10 partidos se han superado los 2 goles que necesitamos por lo que tendriamos un 7 de 12 verdes. Casualmente, siempre que anota 2 goles o mas esta apuesta se ha pintado de verde y la Real Sociedad ha recibido 2 o mas goles en 7 de los 11 partidos que ha jugado como visitante. De visitante, una Real Sociedad que sigue sin conseguir ese buen juego de principio de liga o de algunos partidos sueltos como vs Deportivo o Levante. En 11 partidos: 3 victorias, 2 empates y 6 derrotas. Momento malo el que vive el conjunto de Eusebio Sacristan fuera de Anoeta ya que no conoce la victoria en las ultimas 7 salidas en liga con 5 derrotas y 3 empates, por lo que la tendencia para que la primera parte de la apuesta salga es positiva. Ademas, es uno de los equipos que mas goles recibe como visitante con una media de 2 por partido (y como he dicho antes, siempre que el Valencia mete 2 goles mas gana el partido, por lo que espero que sea buena senal). De los 8 partidos que no ha ganado, 5 se han dado +2,5 goles (todos derrotas) por lo que en 5 de los 11 partidos esta apuesta seria acertada. A todo esto hay que sumarle que juega un partido muy importante frente al Salzburgo en la que se juega la clasificacion a octavos de la Europa League por lo que puede que algunos jugadores descansen el domingo o no esten en plenitud de forma. Por tanto, nos encontramos un Valencia superior a su contrincante y ademas en gran forma cuando juega en su feudo y todo lo contrario en una Real Sociedad que a su dificultad para sacar resultados positivos lejos de Anoeta se unen la facilidad con la que concede gol y un importante partido en competicion europea (de visitante lo que conlleva un viaje y mayor cansancio) por lo creo que se puede dar una victoria del Valencia con unos cuantos goles en su haber, cubriendonos un posible 2-1 o algun empate con muchos goles.',557091,32791),(32794,9,'Nos vamos a Villareal. Partido en la matinal del domingo que enfrentaran el Villareal y el Getafe. Por un lado vemos a un Villareal que en las ultimas jornadas esta flaqueando un poco. En los ultimos 4 partidos ha perdido 3 y a empatado 1. Creo que el Villareal esta jugando bien, al toque y con posesiones largas aunque creo que atras es donde se esta dejando los puntos. Por otro lado un Getafe, el rey del empate que lleva desde el dia de reyes sin conocer la victoria y que ha empatado los ultimos 4 partidos , el ultimo en un meritorio empate ante un gran Barcelona. Pero creo que en este partido todo volvera a su normalidad y creo que el Villareal se llevara los tres puntos ya que no se puede permitir el lujo de perder muchos puntos en casa y que llevaba tres partidos consecutivos ganando en casa ante R.Sociedad, Levante y Leganes. Me gusta mucho este ano el Getafe pero creo que ahora vamos a entrar en Marzo y los equipos importantes saben lo que se juegan y los equipos como el Getafe pueden pagar el desgaste de la temporada, asi que confiemos en la victoria de los de Villareal . Mucha suerte',557092,32793),(32796,9,'Primera visita del Girona al Camp Nou como equipo de primera division donde no tiene nada que perder y donde puede seguir demostrando que es el equipo revelacion de este campeonato. Nadie esperaba al inicio de la competicion que el Girona estuviera donde esta y sobre todo hay que decir que con todo merecimiento ya que esta haciendo una campana fantastica. Mi pronostico va por que ambos consiguen marcar. Por parte local nadie duda que el Barcelona consiga gol, todo lo que no sea esto sera un sorpreson mayusculo. La dificultad del pronostico esta en el gol visitante pero es que si miramos los partidos jugados por el Girona fuera de su estadio tenemos que en 8 de los 12 encuentros ha conseguido marcar: 10-09-2017 Ath Bilbao2 - 0 Girona 20-09-2017 Leganes 0 - 0 Girona 29-09-2017 Celta 3 - 3 Girona 23-10-2017 La Coruna1 - 2 Girona 05-11-2017 Levante 1 - 2 Girona 25-11-2017 Betis 2 - 2 Girona 11-12-2017 Espanol 0 - 1 Girona 21-12-2017 Eibar 4 - 1 Girona 06-01-2018 Valencia2 - 1 Girona 20-01-2018 Ath Madrid1 - 1 Girona 27-01-2018 Malaga 0 - 0 Girona 11-02-2018 Sevilla 1 - 0 Girona Se que no va a ser facil pero un equipo que juega sin presion y sin complejos puede ser capaz de esto y mas.',557093,32795),(32798,9,'Partido de la Liga Santander entre Barcelona y Girona. Derbi catalan que se disputa por primera vez en la historia en terreno blaugrana, y que llega con ambos equipos en buen momento de forma salvando las distancias. Los azulgranas son lideres solidos del campeonato, no han perdido ningun partido en lo que va de liga y tras 2 empates que hicieron dudar, han vuelto a la senda del triunfo en Ipurua. Por su parte los gerundenses son uno de los equipos revelacion del campeonato, capaces de lo mejor y lo peor, pero no cabe duda de que van a pelear por un puesto en Europa. El Barcelona tiene capacidad para hacer el solo 4 o mas goles en un partido si se lo propone, pero teniendo en cuenta que disputa Champions supongo que trataran de guardas fuerzas, y ademas como vamos a ver a continuacion no es facil ver un partido del Girona con 4 o mas goles. Los azulgranas en 24 partidos de liga tan solo en 4 se marcaron mas de 4 goles y en 2 fueron 4 justos. Curiosamente los de Girona igualan estas estadisticas globales. Barcelona como local: 11 partidos jugados, 7 verdes, 2 nulos y 2 rojos. Girona como visitante: 12 partidos jugados, 9 verdes, 1 nulo y 2 rojos. Ambos equipos no han superado los 4 goles en sus partidos desde septiembre. Lo veo bastante factible. Stake 1 y suerte. P.D. Habia decidido dejar de pronosticar, pero al menos voy a cumplir este mes y decidire lo que hago el mes proximo.',557094,32797),(32800,9,'El equipo de Barcelona juega en casa luego de su partido en Inglaterra contra el Chelsi. Este duelo sera muy interesante por lo que vienen mostrando ambos equipos ya que el equipo de Girona se a convertido en el equipo revelacion esta temporada por lo bien que lo viene haciendo, pero en sud visita a las vida condal sera uno de los mas complicado por la calidad de jugadores que posee el equipo Cule. Esta vez nos vamos con que el Barcelona gana aqui dejando su porteria a cero goles ya que la sera muy dificil por parte del girona romper el cerrojo defensivi y la garantia que ofrecer Ters Tegen bajo los tres palos del equipo azulgrana.',557095,32799),(32802,9,'El partido de la jornada enfrenta a dos de los grandes de la liga en los ultimos anos. Aunque este ano son equipos que meten pocos goles, ya demostraron en la copa que no se tienen miedo. El Atletico lucha por seguir al Barcelona, en su pelea por la liga. A pesar de no llevar muchos goles, los rentabiliza muy bien, de hecho ha marcado en 20 de los 24 partidos de liga, y solo ha perdido un partido en toda la temporada. El Sevilla esta quinto y ya lo separan 7 puntos del cuarto, si el Madrid gana al Leganes el miercoles. Le complica mucho clasificarse para la Champions el ano que viene, pero si se descuida podria quedar fuera de la Europa League, ya que solo le saca 4 puntos al septimo. El mes pasado en la copa ambos equipos nos deleitaron con dos partidos entretenidos y con goles de ambos equipos. Sevilla-Atletico de Madrid 3-1 Atletico de Madrid-Sevilla 1-2 Creo que sera un partido igualado y que ambos marcaran, ya que un empate no beneficia a ninguno de los dos.',557096,32801),(32804,9,'Jornada 25. Partido de primera division espanola. Se enfrentan el Sevilla frente al atletico de madrid. Vamos con el conjunto rojiblanco, segundo clasificado y equipo menos goleado de toda la primera division. Como ya sabemos, el Sevilla no es un rival sencillo. Pero con esta cuota merece la pena probar y sin duda con un buen criterio. Tenemos a nuestro favor que el equipo madrileno tiene toda la semana de descanso, mientras que el Sevilla juega este martes en champions un dificil encuentro ante el Manchester United de mourinho. El Atletico ha empezado 2018 como un tiro, la entrada de costa y vitolo se hace notar y ademas tenemos a un correa y griezmann muy en forma. Es un partido complicado pues el sanchez pizjuan es una olla a presion en este tipo de encuentros y ademas el sevilla viene de ganar sus 3 ultimos partidos. Ahora el atletico se enfrenta a uno de los rivales mas duros de la liga. Sobre todo en su campo. Y no puede permitirse el lujo de dejarse puntos. Hay que tener en cuenta que juegan en el camp nou en 2 jornadas despues, pues la exigencia es maxima. En resumidas cuentas, partido dificil pero con esta cuota hay que ir con los del cholo. Estan en espectacular estado de forma y no pueden dejar escapar mas al Barcelona si quieren tener opciones de luchar en la liga. Ante todo respetamos stake .',557097,32803),(32806,9,'El Deportivo que esta en zona de descenso a 3 puntos de la salvacion, con el cambio de tecnico lleva dos partidos jugados y dos partidos perdidos por la minima sin haber marcado ni un gol, raro esto ya que juega con jugadores muy ofensivos, cuatro delanteros! este Deportivo esta en la cuerda floja y necesita sacar algun partido adelante sobre todo en casa, espero el primer gol del equipo corunes con Seedorf como entrenador, sobre todo jugando en casa. Si a eso le anadimos que el Depor defensivamente es el equipo mas goleado de La Liga con 53 tantos en 24 partidos. El Espanyol que tambien esta en la zona baja de la tabla pero a 9 puntos del descenso no puede permitirse perder partidos, en sus 4 ultimos partidos (2 fueras de casa y 2 de local) tendriamos el verde, ya que ha marcado y ha recibido gol en todos ellos. En su enfrentamiento de esta temporada alla por septiembre en Barcelona, gano el Espanyol por 4-1, ambos marcaron, y si nos fuesemos a los partidos jugados la temporada pasada, tendriamos otros dos verdes con un 1-1 en Barcelona y un 1-2 en Riazor.',557098,32805),(32808,9,'Ambos equipos pasan por sus peores momentos en la Liga, el Deportivo se ha metido en los puestos de descenso y sera complicado salir de ahi. El Espanyol de momento tiene margen, pero como no espabile podria verse con el descenso picando a su puerta. El Deportivo con la llegada de Seedorf, ha mejorado en defensa. Ha perdido los ultimos 2 partidos por 1-0, pero ahora parece que le cuesta hacer gol, lo cual parece imposible con delanteros como Lucas Perez, Bakali, Andone y Adrian. Ahora les toca a ellos cambiar la dinamica del equipo y transormar los resultados en victorias. La baja de Bakkali por acumulacion de tarjetas, podria dar entrada a Cartabia, jugador mas tecnico y desborda muy bien por la banda. El Espanyol lleva 7 partidos sin ganar, ha empatado en los ultimos partidos en los minutos finales, pero no acaban de realizar un buen juego. Gerar Moreno que lleva 10 goles podria chocar con la buena defensa que ha implantado Seedorf y dejar la porteria del Deportivo a 0.',557099,32807),(32810,9,'Viendo la trayectoria de ambos equipos en los ultimos partidos, no es una apuesta tan arriesgada. El Leganes con el trabajo hecho, esta practicamente salvado, los tres de abajo es muy dificil que superen los 35 puntos, lo que dejaria al Leganes a tan solo dos victorias de conseguir la permanencia. La copa les ha pasado factura y encadenan una mala racha con 2 derrotas, 2 empates y 1 victoria. Girona-Leganes 3-0 Leganes-Eibar 0-1 Getafe-Leganes 0-0 Leganes-Espanyol 3-2 Alaves-Leganes 2-2 Sin embargo Las Palmas desde la llegada de Jemez, dominan los partidos y crean mas ocasiones de gol. Sus ultimos partidos le han plantado cara a los equipos de arriba, han ganado al Valencia y casi logran un empate la semana pasada contra el Sevilla, con un gol anulado en el ultimo minuto. Sus ultimos 5 partidos han ganado 2, empatado 1 y perdido 2. Las Palmas-Sevilla 1-2 Athletic Club-Las Palmas 0-0 Las Palmas-Malaga 1-0 Atletico de Madrid-Las Palmas 3-0 Las Palmas-Valencia 2-1 Las Palmas con el nuevo sistema es mas agresivo y va a por el partido, veo muchas posibilidades de que acabe marcando gol. El Leganes saca provecho a sus escasos goles, pero si recibe un gol veo muy lejana la posibilidad de que gane el partido. Apostar por el X2 hubiese sido mas seguro, pero prefiero arriesgar un poco para aumentar las ganancias.',557100,32809),(32812,9,'Pues hombre, ya, sin Jonathan Vieira, pocas dudas...Por mucho que se invente Paco Jemez, estos no le meten un gol al Leganes ni apelando al monstruo...(aun con el llevan 18 goles a favor, no quiero pensar ahora con el en China). El Leganes sale a gol por partido en casay las Plmas no ha marcado en sus ultimas siete salidas asi que imposible no es... En 6 de los 7 ultimos partidos en casa, el Lega \'nos hubiera respetado\' el under y es que muchos de los 29 puntos que lleva, se los debe a su orfen defensivo... PACO parece que ha parado la sangria defensiva pero aun tardara un par de semanas en buscar un sustituto al \'emigrante\' (no creo que Callerivde el nivel...) Veremos... Que haya suerte...',557101,32811),(32814,9,'Partido entre Celta y Eibar donde me decanto porque se marcaran mas de 2,5 goles en el encuentro. He observado la trayectoria de ambos conjuntos hasta el momento y me parece que es un pronostico con grandes posibilidades de que se de. El Celta es el segundo equipo de toda la competicion que mas resultados positivos ha tenido en este pronostico. En 17 de los 23 partidos disputados se han dado mas de esta cantidad de goles. El Eibar tampoco tiene malos numeros y en 14 ocasiones tambien habriamos obtenido el verde. Vemos que en ambos casos estamos muy por encima del 50 por ciento de casos positivos que serian los que marcaran la cuota que encontramos. Asi pues merece la pena arriesgar un poquito y lanzarnos a por el verde.',557102,32813),(32816,9,'Arriesgada es la palabra, como bien lo describe mi Stake, una apusta con una cuota tentadora, pero con los riesgos que implica, debemos tener en cuenta ambas realidades, por un lado Celta, un equipo que pinto para bueno, o al menos para pelear un puesto de competencia europea, termino demostrando ser muy irregular, consiguiendo resultados dificiles, y perdiendo otras mas accesibles, en fin... algo que me inclina a realizar una apuesta en favor de este equipo es su abanderado en ataque el uruguayo Maxi Gomez, quien apenas en Espana comenzo a demostrar que vale lo que pesa, un jugador que siempre aporta algo, la mayoria de las veces anota goles, 1, y hasta 2 por partido, pero aun asi el Celta en muchas ocasiones se va con manos vacias, en frente esta el Eibar, firme tras la caida en su casa frente a Barcelona, un partido que era perdible desde el comienzo, es por eso que no are mucho incapie en eso, si voy a mirar el pasado, y debo admitir que Eibar es un duro rival, y esta convencido de que tiene con que hacer dano, incluso quizas lo veamos en la proxima europa league. Amigos tomando mis recaudos, y sabiendo que es una apuesta bastante arriesgada, voy con el triunfo del Celta, espero que frente a su publico logre dar lo mejor, y vaya que lo tiene. Saludos.',557103,32815),(32818,9,'Tres puntos los separan, el Eibar septimo en una supuesta posicion de Europa League y el Celta en la posicion undecima. Los dos equipos empezaron haciendo una mala temporada pero ahora los dos equipos estan luchando por lo que tenian que luchar desde el principio. La meta de los dos es la de meterse en Europa y este partido es uno de los mas importantes de lo que queda de temporada, ya que seria alejarse o acercarse de un equipo que lucha por su misma meta. El Celta esta temporada nunca sabes si va a hacer un buen partido o no, despues de un gran partido donde solo pudo empatar en su ultimo partido en casa ante el Espanyol, viene de perder de manera contundente por 3-0 en Getafe. El Eibar viene en una muy buena racha, aun que perdio contra el Barcelona en su ultimo partido, pero se podia esperar. Si nos fuesemos a los ultimos enfrentamientos, tendriamos 3 esta temporada con 3 victorias celestes. En Liga gano alla a finales de septiembre por 0-4 (0-3 al descanso). En la Copa se enfrentaron en octubre otra vez en casa del Eibar con un 1-2 (1-2 al descanso) para el conjunto celeste y en el partido de vuelta en noviembre en Balaidos por 1-0 (0-0 al descanso). En esos momentos creo que el Eibar estaba un pelin peor que ahora y por eso preveo un partido mas complicado pero espero que el Celta marque y vaya ganando antes del descanso, por jugar en casa, porque le ha cogido el truquillo al equipo vasco, por la derrota de la pasada semana, por la motivacion de la europa league y por la necesidad de 3 puntos vitales, este equipo dara la cara desde el principio y los gallegos suelen marcar en las primeras partes en la mayoria de sus partidos.',557104,32817),(262145,3,'Buenas Partido entre real betis y levante donde vamos con el over de goles. Para empezar de los 24 partidos que ha disputado el betis solo en 8 no se produjeron mas de 2 goles. El betis es un equipo al que le gusta mucho tener el balon, generar ocasiones de ataque, pero a su vez no cuida tanto la defensa y tiene errores muy groseros atras que le cuestan goles, de hecho solo ha dejado la porteria a 0 en 3 ocasiones. A su vez el betis es el 5º equipo mas goleador de la liga, ya que como digo le gusta tener el balon y genera mucho peligro por las bandas sobretodo con joaquin por la derecha, de hecho el betis es el 2º equipo que mas ocasiones genera por esa banda donde se entienden muy bien el del puerto y barragan. si a esto le unimos que el levante encaja una media de 2 goles por partido, va a tener una presion anadida de ganar y eso no siempre es bueno, creo que vamos a ver de nuevo un partido con muchos goles. Ya en la ida quedaron 4-0, si bien el lunes espero un partido mas disputado, creo que cada equipo puede marcar un par de goles.',557105,262144),(262147,3,'El Estadio Ciudad de Valencia acogera el Levante v Betis,ultimo partido de la 25ª jornada de la Liga Santander que se jugara el Lunes a las 21:oo horas. El Levante esta tan solo a 2 puntos del descenso directo y se lo juegan todo en estas ultimas jornadas de liga,el Betis esta en la zona medio alta y suena con poder alcanzar esos puestos europeos de los que les separan 5 puntos. El Levante llega al partido despues de haber caido ante la Real Sociedad,un equipo que esta atravesando por un momento duro y no gana desde el 4 de Enero que gano al Espanol en Cornella 1-2,si no empieza a sumar puntos ya posiblemente el ano que viene este en la segunda division. Llega a este encuentro contra este Betis muy irregular,capaz de lo mejor y de lo peor. LLegan con las bajas de Ivan Lopez, Alex Alegria y Raul Fernandez,todos lesionados. El Betis tambien perdio en su ultimo duelo con el Real Madrid en un partido donde este Betis cuajo una 1ª parte muy buena,pero los errores defensivos y el acierto de los jugadores blancos,dejaron sin premio a este Betis atrevido. El conjunto de Quique Setien tiene el calsificarse para la proxima Europa League en el punto de mira,saben que juegan ante un Levante que lleva ya 8 partidos consecutivos sin acariciar la Victoria. El Betis viaja a Valencia con las bajas de Gimenez,Feddal y Sanabria,todos lesionados. Voy a ir a doble oportunidad a este Levante teniendo en cuenta que este partido ante su aficion les puede meter en descenso directo,saldran a morir y sabiendo tambien de la irregularidad de este Betis con futbol a rafagas y desconexiones incomprensibles y sabiendo que Sanabria esta lesionado,que el Levante suma en casa 1X. Suerte amigos ;)',557106,262146),(262149,3,'Nos encontramos con el partido de Liga de la jornada 25 que se disputara el Lunes y enfrenta al Levante U.D. y al Real Betis. Por un lado el Levante que promedia unos 2,5 goles por partido teniendo una media de 0,9 goles por partidos marcado y 1.5 encajados, con tan solo 3 partidos ganados en esta temporada, de los cuales nos sorprende que ninguno de ellos ha sido en su feudo. Y por el otro lado el visitante, el Real Betis, equipo que con la filosofia de Setien marca muchos goles pero tambien encaja contando con una de las defensas mas vulnerables de la liga, promediando una media de 3,8 goles por partido, de lo cual 1,7 goles marcados y algo mas de 2 encajados por partido. Segun lo anterior y visto las dinamicas nos ponen muy favorable en cuanto a los goles pronosticados, a esto le sumamos que de los ultimos 4 partidos que los han enfrentado se han saldado con 4 victorias verdiblancas, de las cuales la ultima en la ida fue de 4-0, resultado que nos daria por bueno este pronostico. Veo un buen valor a esta apuesta y me choca que Sportium en este caso de tanto por este pronostico mas aun contando con las posibles bajas del Levante. Sin mas, a disfrutar, que haya muchos goles y sobre todo a apostar con cabeza.',557107,262148),(262151,3,'En los ultimos 5 partidos de Liga de Levante UD se anotaron mas de 2.5 goles El Real Betis ha logrado mantener una hoja limpia contra el Levante UD en sus ultimos 3 partidos de liga El Real Betis cede un promedio de 2,15 goles en todas las competiciones El Real Betis ha concedido un promedio de 2 goles en sus partidos fuera de casa. Levante UD esta concediendo un promedio de 1.58 goles en los partidos de La Liga El Levante UD esta concediendo un promedio de 1.5 goles en sus juegos locales de La Liga El Real Betis ha concedido al menos dos goles en 12 de sus ultimos 18 partidos fuera de la liga. Levante UD ha permitido 2+ goles en 7 de sus ultimos 8 partidos en todas las competiciones Real Betis ha marcado mas de 2 goles en 5 de sus ultimos 7 partidos de liga. Se han visto mas de 2.5 goles en 6 de los ultimos 7 partidos del Real Betis en La Liga Levante UD ha permitido 2+ goles en 4 de sus ultimos 6 partidos en casa en La Liga Real Betis ha concedido 3+ goles en 3 de los ultimos 5 partidos de la liga',557108,262150),(262153,3,'Buenas Cuota desproporcionada para mi gusto la victoria con empate nulo del equipo verdiblanco. El levante tiene un equipo bastante inferior en calidad al betis y en cada linea del campo, sobre todo en la delantera donde el betis tiene una competencia muy grande. El levante viene de una racha muy mala donde ha conseguido 5 de los ultimos 33 puntos, tiene un juego pobre basado en alguna chispa de calidad de bardhi o ivi. Tal vez en ataque con roger o pazzini viendo en ocasiones la fragilidad del betis es donde mas podria sufrir el equipo verdiblanco, pero la llegada de bartra y el cambio de sistema con 5 defensas deberia hacer valer la superioridad en defensa. El betis con un loren que ha marcado 3 goles en 3 partidos, un sergio leon que viene de marcaral madridy un joaquin que pasa por su segunda juventud creo que van a hacer mucho dano al equipo granota, fabian y boudebouz tambien estan a muy bien nivel y pueden marcar la diferencia. Veo muy raro que el levante pueda ganar al betis.',557109,262152),(262155,3,'Me extrana que en este partido se de como favorito al Levante. El equipo local 17º con 20 puntos a tan solo uno del descenso, recibe a un Betis algo irregular pero 11º con 33 puntos a tan solo 6 de puestos europeos. Es decir, en el caso de conseguir la victoria, y si el Sevilla pierde hoy contra el ATM, se pondria a tan solo 3 puntos. El Betis ha ganado 3 de sus ultimas 5 visitas y ha ganado en sus dos ultimas visitas al campo del Levante. El equipo local lleva 12 partidos sin ganar, con el entrenador en la cuerda floja y con un rival bastante incomodo como suele ser el Betis, la cuota me parece que tiene bastante valor. Los ultimos 4 enfrentamientos directos, se han decantado por el Betis. Suerte!',557110,262154),(262157,3,'Stake 1 Vamos con una apuesta de estadistica para el partido que cierra esta jornada en la liga espanola, entre el Levante y el Betis. Buscamos que el central argelino haga al menos dos entradas y sean contabilizadas por whoscored. Como siempre sino es titular apuesta NULA. Vamos a analizar el pick desde tres puntos de vista distintos, el propio jugador, el Betis y los rivales del Levante. El Jugador: Mandi tiene de media 1,57 entradas por partido en 21 partidos jugados, otro punto a favor es que suele jugar los 90 minutos, esto es bueno ya que cuanto mas tiempo este en el campo, mas probable de pintar la apuesta de verde. Betis: El club de Sevilla no es de los equipos que mas entradas promedian en esta liga, de hecho es el tercero que menos con 15,9 por encuentro, aunque esta media sube cuando juega fuera de casa. Voy a analizar todos los partidos disputados por el Betis fuera de casa poniendo el numero de entradas totales y el numero de entradas de Mandi (entre parentesis). 18 vs Barcelona (1) 10 vs Villareal (No jugo) 10 vs Real Madrid (0) 18 vs Real sociedad (0) 17 vs Espanyol (1) 14 vs Eibar (4) 16 vs Las Palmas (3) 22 vs Malaga (1) 22 vs Sevilla (0) 18 vs Celta de Vigo (4) 19 vs Deportivo (2) La media del conjunto verdiblanco es de 16,72 y Mandi hubiera pintado esta apuesta de verde en 4 ocasiones. RIVALES DEL LEVANTE: Vamos ahora a ver las entradas de los equipos que se han visitado el campo del Levante y entre parentesis pondre las entradas del central derecho. 24 Villareal (3) Alvaro Gonzalez 22 Deportivo (3) Schar 23 Valencia (1) Garay 15 Real sociedad (0) Elustondo. No acabo el partido 20 Alaves (1) Rodrigo Ely 26 Getafe (3) Dakonam. No acabo el partido 14 Girona (4) Juanpe 16 Bilbao (2) Unai nunez 29 Leganes (1) Dos Santos 17 Celta de Vigo (1) Cabral 18 Real Madrid (0) Varane Los rivales promedian 20,36 entradas, y los centrales derechos han superado esta apuesta en 5 ocasiones. Creo que el Betis saldra con 3 centrales Amat, Bartra y Mandi, por lo que espero que sea Bartra quien juegue en el medio y Mandi tenga que salir a cortar alguna jugada ofensiva del Levante con lo que aumentaria sus posibilidades de obtener 2 entradas. Un saludo y suerte',557111,262156);
